import './Floor2.css';

function Floor2() {
  return (
    <div className='containerF2'>
        <div className='right'>
            <p className='line'> - </p>
            <p clas>World Padel Tour et Kuikma</p>
            <p>Le World Padel Tour est le circuit professionnel qui réunit les meilleurs joueurs du monde. Cette année, il se déroulera à Bruxelles, à Tour & Taxis, du 4 au 8 mai .</p>
            <p>Au programme : des matchs de classe mondiale entre les 60 meilleurs joueurs du monde, des matchs d’exhibition, DJ, foodtrucks et bars… le combo parfait pour vibrer en famille, entre amis ou entre collègues. 
            Kuikma sera également présent avec ses ambassadeurs renommés et sa gamme Expert.</p>
        </div>
        <div className='left'></div>
    </div>
  );
}

export default Floor2;
